import React from 'react';
import '../styles/footer.css';

import GitHubIcon from '@mui/icons-material/GitHub';
import Logo from '../assets/Logo_LSC.png';

function Footer() {
  return (
    <footer>
      <img src={Logo}/>
      <div>
        <GitHubIcon />
      </div>
    </footer>
  )
}

export default Footer
